== 简介 ==
'''ビバハピ(Viva Happy)'''（中文：《開心萬歲》）是[[Mitchie M]]於2013年07月26日投稿至niconico和Youtube的作品。为Mitchie M的代表作之一。44天之內达成[[Vocaloid傳說曲|傳說曲]]。在YouTube上Mitchie M特別感謝Vocaloid.cl（西班牙文）、Keysckm（韓文）、kyroslee（中文）三人的翻譯。


{{Cquote|<big>我是 Mitchie M。让miku像声优一样发声及Rap所作成的歌曲。已经试着努力过了，如果有声优藤田咲桑的声音特征給活用的话就好了，如果各位能跟可愛MIKU的MMD PV一起同欢就太好了。</big>|<big>Mitchie M</big>}}

